    text: "Приготовьтесь вашейо команде предстоит исследовть крайне холодные места омской области, на встречу вам будут попадаться дикие хищники, а путь будут преграждать леса. Но для того что бы узнать куда вы отправляетесь вам предстоит узнать направление куда вы отправитесь "

